const DetailsInfo = (props) => {
    const details = props.details;
    const title = props.title;

    return ( 
        <div className="details-info">
        <h1>{title} </h1>
              {
                    details.map( (detail) => (
                    <div className="info" key={detail.id}>
                        <h2>hhhhhh{detail.completeName}</h2>
                    </div>
             ))}
        </div>
     );
}
 
export default DetailsInfo;
